svg.asciisvg:
// Initialize our picture initPicture(-0.3,2.3,-1.3,1.3)
// Set the fontsize large for the axes fontsize=25 axes(1, 1, "labels", 1)
// Set a thick blue stroke strokewidth = "2" stroke = "blue" // Plot our function plot("x",0,1) plot("1-x",1,2)
dotradius = "8" dot([1,1], "open", "") dot([1,0], "closed", "") dot([0,0], "closed", "") dot([2,-1], "closed", "")
// Set the font for the graph label fontstyle="italic" fontfamily="times" fontsize=40 fontfill = "blue" // To the left of point (2,1.1), display the text text([1.8,0.5], "y=g(x)", 'left')
